    url_field: uriModel = Field(default=None, alias="url", description="An absolute URI that is used to identify this capability statement when it is referenced in a specification, model, design or an instance; also called its canonical identifier. This SHOULD be globally unique and SHOULD be a literal address at which an authoritative instance of this capability statement is (or will be) published. This URL can be the target of a canonical reference. It SHALL remain the same when the capability statement is stored on different servers.")
    identifier_field: List[IdentifierModel] = Field(default_factory=list, alias="identifier", description="A formal identifier that is used to identify this CapabilityStatement when it is represented in other formats, or referenced in a specification, model, design or an instance.")
    version_field: stringModel = Field(default=None, alias="version", description="The identifier that is used to identify this version of the capability statement when it is referenced in a specification, model, design or instance. This is an arbitrary value managed by the capability statement author and is not expected to be globally unique. For example, it might be a timestamp (e.g. yyyymmdd) if a managed version is not available. There is also no expectation that versions can be placed in a lexicographical sequence.")
    versionAlgorithmCoding_field: CodingModel = Field(default=None, alias="versionAlgorithmCoding", description="Indicates the mechanism used to compare versions to determine which is more current.")
    name_field: stringModel = Field(default=None, alias="name", description="A natural language name identifying the capability statement. This name should be usable as an identifier for the module by machine processing applications such as code generation.")
    title_field: stringModel = Field(default=None, alias="title", description="A short, descriptive, user-friendly title for the capability statement.")
    status_field: codeModel = Field(default=None, alias="status", description="The status of this capability statement. Enables tracking the life-cycle of the content.")
    experimental_field: booleanModel = Field(default=None, alias="experimental", description="A Boolean value to indicate that this capability statement is authored for testing purposes (or education/evaluation/marketing) and is not intended to be used for genuine usage.")
    date_field: dateTimeModel = Field(default=None, alias="date", description="The date  (and optionally time) when the capability statement was last significantly changed. The date must change when the business version changes and it must change if the status code changes. In addition, it should change when the substantive content of the capability statement changes.")
    publisher_field: stringModel = Field(default=None, alias="publisher", description="The name of the organization or individual responsible for the release and ongoing maintenance of the capability statement.")
    contact_field: List[ContactDetailModel] = Field(default_factory=list, alias="contact", description="Contact details to assist a user in finding and communicating with the publisher.")
    description_field: markdownModel = Field(default=None, alias="description", description="A free text natural language description of the capability statement from a consumer's perspective. Typically, this is used when the capability statement describes a desired rather than an actual solution, for example as a formal expression of requirements as part of an RFP.")
    useContext_field: List[UsageContextModel] = Field(default_factory=list, alias="useContext", description="The content was developed with a focus and intent of supporting the contexts that are listed. These contexts may be general categories (gender, age, ...) or may be references to specific programs (insurance plans, studies, ...) and may be used to assist with indexing and searching for appropriate capability statement instances.")
    jurisdiction_field: List[CodeableConceptModel] = Field(default_factory=list, alias="jurisdiction", description="A legal or geographic region in which the capability statement is intended to be used.")
    purpose_field: markdownModel = Field(default=None, alias="purpose", description="Explanation of why this capability statement is needed and why it has been designed as it has.")
    copyright_field: markdownModel = Field(default=None, alias="copyright", description="A copyright statement relating to the capability statement and/or its contents. Copyright statements are generally legal restrictions on the use and publishing of the capability statement.")
    copyrightLabel_field: stringModel = Field(default=None, alias="copyrightLabel", description="A short string (<50 characters), suitable for inclusion in a page footer that identifies the copyright holder, effective period, and optionally whether rights are resctricted. (e.g. 'All rights reserved', 'Some rights reserved').")
    kind_field: codeModel = Field(default=None, alias="kind", description="The way that this statement is intended to be used, to describe an actual running instance of software, a particular product (kind, not instance of software) or a class of implementation (e.g. a desired purchase).")
