    imports_field: List[canonicalModel] = Field(default_factory=list, alias="imports", description="Reference to a canonical URL of another CapabilityStatement that this software adds to. The capability statement automatically includes everything in the other statement, and it is not duplicated, though the server may repeat the same resources, interactions and operations to add additional details to them.")
    software_field: CapabilityStatement_SoftwareModel = Field(default=None, alias="software", description="Software that is covered by this capability statement.  It is used when the capability statement describes the capabilities of a particular software version, independent of an installation.")
    implementation_field: CapabilityStatement_ImplementationModel = Field(default=None, alias="implementation", description="Identifies a specific implementation instance that is described by the capability statement - i.e. a particular installation, rather than the capabilities of a software program.")
    fhirVersion_field: codeModel = Field(default=None, alias="fhirVersion", description="The version of the FHIR specification that this CapabilityStatement describes (which SHALL be the same as the FHIR version of the CapabilityStatement itself). There is no default value.")
    format_field: List[codeModel] = Field(default_factory=list, alias="format", description="A list of the formats supported by this implementation using their content types.")
    patchFormat_field: List[codeModel] = Field(default_factory=list, alias="patchFormat", description="A list of the patch formats supported by this implementation using their content types.")
    acceptLanguage_field: List[codeModel] = Field(default_factory=list, alias="acceptLanguage", description="A list of the languages supported by this implementation that are usefully supported in the ```Accept-Language``` header.")
    implementationGuide_field: List[canonicalModel] = Field(default_factory=list, alias="implementationGuide", description="A list of implementation guides that the server does (or should) support in their entirety.")
    rest_field: List[CapabilityStatement_RestModel] = Field(default_factory=list, alias="rest", description="A definition of the restful capabilities of the solution, if any.")
    messaging_field: List[CapabilityStatement_MessagingModel] = Field(default_factory=list, alias="messaging", description="A description of the messaging capabilities of the solution.")
    document_field: List[CapabilityStatement_DocumentModel] = Field(default_factory=list, alias="document", description="A document definition.")

