    statusReason_field: CodeableConceptModel = Field(default=None, alias="statusReason", description="Captures the reason for the current state of the MedicationRequest.")
    statusChanged_field: dateTimeModel = Field(default=None, alias="statusChanged", description="The date (and perhaps time) when the status was changed.")
    intent_field: codeModel = Field(default=None, alias="intent", description="Whether the request is a proposal, plan, or an original order.")
    category_field: List[CodeableConceptModel] = Field(default_factory=list, alias="category", description="An arbitrary categorization or grouping of the medication request.  It could be used for indicating where meds are intended to be administered, eg. in an inpatient setting or in a patient's home, or a legal category of the medication.")
    priority_field: codeModel = Field(default=None, alias="priority", description="Indicates how quickly the Medication Request should be addressed with respect to other requests.")
    doNotPerform_field: booleanModel = Field(default=None, alias="doNotPerform", description="If true, indicates that the provider is asking for the patient to either stop taking or to not start taking the specified medication. For example, the patient is taking an existing medication and the provider is changing their medication. They want to create two seperate requests: one to stop using the current medication and another to start the new medication.")
    medication_field: CodeableReferenceModel = Field(default=None, alias="medication", description="Identifies the medication being requested. This is a link to a resource that represents the medication which may be the details of the medication or simply an attribute carrying a code that identifies the medication from a known list of medications.")
