    supportingInformation_field: List[ReferenceModel] = Field(default_factory=list, alias="supportingInformation", description="Information to support fulfilling (i.e. dispensing or administering) of the medication, for example, patient height and weight, a MedicationStatement for the patient).")
    authoredOn_field: dateTimeModel = Field(default=None, alias="authoredOn", description="The date (and perhaps time) when the prescription was initially written or authored on.")
    requester_field: ReferenceModel = Field(default=None, alias="requester", description="The individual, organization, or device that initiated the request and has responsibility for its activation.")
    reported_field: booleanModel = Field(default=None, alias="reported", description="Indicates if this record was captured as a secondary 'reported' record rather than as an original primary source-of-truth record.  It may also indicate the source of the report.")
    performerType_field: CodeableConceptModel = Field(default=None, alias="performerType", description="Indicates the type of performer of the administration of the medication.")
    performer_field: List[ReferenceModel] = Field(default_factory=list, alias="performer", description="The specified desired performer of the medication treatment (e.g. the performer of the medication administration).  For devices, this is the device that is intended to perform the administration of the medication.  An IV Pump would be an example of a device that is performing the administration.  Both the IV Pump and the practitioner that set the rate or bolus on the pump can be listed as performers.")
